import React from "react";
import logo from '../images/logo.png'
class Footer extends React.Component{
    render(){
        return(
            <footer className="Footer">
                <div className="Footer-contact">
                    <img src={logo} className="Footer-"/>
                </div>
            </footer>
        )
    }
}

export default Footer;
